-- ----------------------------
--  View structure for [dbo].[today_ticket_simple]
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID('[dbo].[today_ticket_simple]') AND type IN ('V'))
	DROP VIEW [dbo].[today_ticket_simple]
GO
CREATE VIEW [dbo].[today_ticket_simple] AS select today_airflight.afid afid,
           T.start_place start_place,
           T.arrive_place arrive_place,
           today_airflight.start_time start_time,
           today_airflight.arrive_time arrive_time
    from
    (select afid,alid,start_time,arrive_time from t_airflight where DATEDIFF(dd, start_time, GETDATE())=0) today_airflight,t_airline T
    where today_airflight.alid = T.alid
GO

-- ----------------------------
--  Procedure structure for [dbo].purchase
-- ----------------------------
CREATE PROCEDURE [dbo].[purchase] 
    @tid char(36),
    @purchase_time datetime,
    @seat_num int,
    @seat_type varchar(50),
    @uid char(36),
    @afid char(36)
AS
    BEGIN
        insert t_ticket values (@tid,@purchase_time,@seat_num,@seat_type,@uid,@afid)
    end
GO


